import React from 'React'
import Slide from './main/Slide'
import Subtitle from './main/Subtitle'
import Images from './main/Images'
import Listas from './main/Listas'

export default class Main extends React.Component{
	render(){
		return(
			<div>
				<Slide/>
				<Subtitle/>
				<Images/>
				<Listas/>
			</div>
		)
	}
}
